import React, { Component } from 'react';
import { Container, Row, Col } from 'reactstrap';

export default class Home extends Component {
  render() {
    return (
      <div>
        <Container>
          <Row>
            <Col>
              <h3>Test</h3>
            </Col>
          </Row>
        </Container>
      </div>
    )
  }
}
